v></div></section></div>\n<!-- /wp:create-block/content-block -->\n\n<!-- wp:create-block/content-block {\"section_image\":\"http://stitch-it-quick.local/wp-content/uploads/2024/03/Turbo-hoodie.jpg\",\"row_class\":\"row justify-content-start\",\"col_class\":\"col-lg-6 text-white\"} -->\n<div class=\"wp-block-create-block-content-block\"><section class=\"position-relative \" style=\"padding:150px 0;\" id=\"\"><img src=\"http://stitch-it-quick.local/wp-content/uploads/2024/03/Turbo-hoodie.jpg\" alt=\"\" class=\"w-100 h-100 position-absolute bg-img undefined\" style=\"top:0;left:0;object-fit:cover;pointer-events:none;undefined\"/><div class=\"container\" style=\"\" id=\"\"><div class=\"row justify-content-start\" style=\"\" id=\"\"><div class=\"col-lg-6 text-white\" style=\"\" id=\"\" data-aos=\"fade-up\" data-aos-delay=\"\"><!-- wp:heading {\"className\":\"text-shadow\"} -->\n<h2 class=\"wp-block-heading text-shadow\">Stay Comfortable All Day</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Experience all-day comfort, designed with moisture-wicking technology and crafted from soft melange fabric.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"className\":\"arrows\"} -->\n<ul class=\"arrows\"><!-- wp:list-item -->\n<li>Neckline: Hoody</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Sleeve length: Long Sleeve</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Material technology: Moisture Wicking</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Activity: Training</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Material: Melange fabric</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:shortcode -->\n[button href=\"/shop/\" class=\"outline\"]Shop Now[/button]\n<!-- /wp:shortcode --></div></div></div></section></div>\n<!-- /wp:create-block/content-block -->','Custom Embroidery for Gates Enterprises','','publish','closed','closed','','sample-page','','','2024-04-09 19:41:39','2024-04-09 19:41:39','',0,'http://stitch-it-quick.local/?page_id=2',0,'page','',0),(3,1,'2024-03-20 02:04:10','2024-03-20 02:04:10','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://stitch-it-quick.local.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2024-03-20 02:04:10','2024-03-20 02:04:10','',0,'http://stitch-it-quick.local/?page_id=3',0,'page','',0),(4,0,'2024-03-20 02:05:39','2024-03-20 02:05:39','<!-- wp:page-list /-->','Navigation','','publish','closed','closed','','navigation','','','2024-03-20 02:05:39','2024-03-20 02:05:39','',0,'http://stitch-it-quick.local/navigation/',0,'wp_navigation','',0),(6,1,'2024-03-20 02:06:40','2024-03-20 02:06:40','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2024-03-20 02:06:40','2024-03-20 02:06:40','',0,'http://stitch-it-q